    return (
      <div className="container my-3">
        <h2>NewsMonkey - Top Headlines</h2>
        <div className="row my-4">
          <div className="col-md-4">
            <NewsItem title="Title" description="desc" imageUrl="https://i.guim.co.uk/img/media/48c5174374d237b2805a01e74dc22acc7d7b9e25/0_221_5184_3110/master/5184.jpg?width=1200&height=630&quality=85&auto=format&fit=crop&overlay-align=bottom%2Cleft&overlay-width=100p&overlay-base64=L2ltZy9zdGF0aWMvb3ZlcmxheXMvdGctZGVmYXVsdC5wbmc&enable=upscale&s=3154223b0f6e4f5e27a1651135fae856" />
