          <div className="col-md-4">
            <NewsItem title="Title" description="desc" />
          </div>
          <div className="col-md-4">
            <NewsItem title="Title" description="desc" />
          </div>
         
        </div>
        <div className="row my-4">
          <div className="col-md-4">
            <NewsItem title="Title" description="desc" />
          </div>
          <div className="col-md-4">
            <NewsItem title="Title" description="desc" />
          </div>
          <div className="col-md-4">
            <NewsItem title="Title" description="desc" />
          </div>
         
        </div>
      </div>
    );
  }
}

export default News;
